import React from "react";
import "../Layout.css";

function About() {
 return (
    <div className="contact-container">
      <div className="outer-card">
        <h1>Om oss</h1>

        <div className="inner-card">
          <p>Du kan kontakta oss via nedanst√•ende alternativ:</p>
          <ul>
            <li>E-post: <a href="mailto:exempel@kumlasportfiske.se">exempel@kumlasportfiske.se</a></li>
            <li>Telefon: 012-3456789</li>
            <li>Adress: Kommer snart, Kumla</li>
            <li>Facebook: <a href="https://www.facebook.com/kumlasportfiske" target="_blank" rel="noopener noreferrer">kumlasportfiske</a></li>
            <li>Instagram: <a href="https://www.instagram.com/kumlasportfiske/" target="_blank" rel="noopener noreferrer">@kumlasportfiske</a></li>
          </ul>
        </div>
      </div>
    </div>
  );
}

export default About;
